	function postLogging()

		else
		{
			SP.QoS.WriteFailure("UnifiedApp.PageScript.Failure", {"Scenario": scenarioId, "ErrorCode": scriptError});
		}
	  });
	}
	function Base64UrlDecode(base64Url)
	{
		let encodedString = base64Url;
		if (encodedString)
		{
			encodedString = encodedString.replace(/-/g, '+');
			encodedString = encodedString.replace(/_/g, '/');
			switch ((encodedString.length % 4)) {
				case 0:
					break;
				case 2:
					 encodedString += "==";
					 break;
				case 3:
					 encodedString += "=";
					 break;
				default:
					return null;
			}
			return atob(encodedString);
		}
	}
	function BrowserSupportsFetchAndPromise()
	{
		return 'fetch' in window &&
		'Promise' in window &&
		'resolve' in window.Promise &&
		'reject' in window.Promise &&
		'all' in window.Promise &&
		'race' in window.Promise
	}
	function ResetToAddressBarLink(addressUri)
	{
		if (wopiContext)
		{
			var  webAbsoluteUrl = wopiContext.ParentFolderFullUrl
			var  digestUrl = "/_api/contextinfo";
			var  shareLinkExpressUrl = "/_api/web/Lists('" + wopiContext.ListId + "')/GetItemById('" + wopiContext.ListItemId + "')/ShareLinkExpress(1)";
			if (webAbsoluteUrl.substring(webAbsoluteUrl.length-1) == "/")
			{
				webAbsoluteUrl = webAbsoluteUrl.substring(0, webAbsoluteUrl.length-1);
			}
			digestUrl = webAbsoluteUrl + digestUrl;
			fetch(digestUrl, {
				method: 'post',
				headers: {
					"accept": "application/json"
				}})
			.then(function(response) {
				return response.json();
				})
			.then(function(digestData) {
				var webFullUrl = digestData.WebFullUrl;
				shareLinkExpressUrl = webFullUrl + shareLinkExpressUrl;
				return fetch(shareLinkExpressUrl, {
					method: 'post',
					headers: {
						"accept": "application/json",
						"x-requestdigest": digestData.FormDigestValue
					}})
				})
			.then(function(response) {
				return response.json();
				})
			.then(function(linkResponse) {
				if (linkResponse && linkResponse.sharingLinkInfo && linkResponse.sharingLinkInfo.ShareTokenString)
				{
					var queryParameter = linkResponse.sharingLinkInfo.ShareTokenString.split('=');
					addressUri.setQueryParameter(queryParameter[0], queryParameter[1]);
					return true;
				}
				return false;
			})
			.then(function(isAddressBarLink) {
				if (isAddressBarLink)
				{
					history.replaceState({reason: "SPRedirect"}, "SPRedirect", addressUri.getString());
				}
				else
				{
					SP.DebugLogger.Write("SetAddressBarLink", SP.DebugLogger.LoggingLevel.Interesting, "SetAddressBarLink: Could not get back shareable address bar link.");
					history.replaceState({reason: "SPRedirect"}, "SPRedirect", addressUri.getString());
				}
			})
			.catch(function(error) {
				SP.DebugLogger.Write("SetAddressBarLink", SP.DebugLogger.LoggingLevel.Interesting, "SetAddressBarLink caught error: " + error);
				history.replaceState({reason: "SPRedirect"}, "SPRedirect", addressUri.getString());
				console.log(error);
			});
		}
	}
	function ResetUrl()
	{
		var extension = 'w';
		if (extension && history && history.replaceState)
		{
		  try
		  {
			var curUrl = ajaxNavigate.get_href();
			var curUri = new URI(curUrl, {disableEncodingDecodingForLegacyCode: true, queryCaseInsensitive: true});
			const encodedOriginalPath = curUri.getQueryParameter(_paramOriginalPath);
			const originalPath = Base64UrlDecode(encodedOriginalPath);
			if (originalPath)
			{
				history.replaceState({reason: "SPRedirect"}, "SPRedirect", originalPath);
			}
			else
			{
				if(OffSwitch.IsActive("36D2ABA3-59DA-4703-A3CE-FDB8154E0FA2")) {
					if (curUrl.substring(0, 2) !== '/:')
					{
						curUri.setPath("/:" + extension + ":/r" + curUri.getPath());
						curUri.removeQueryParameter(_paramCT);
						curUri.removeQueryParameter(_paramOR);
						curUri.removeQueryParameter(_paramSlrid);
						history.replaceState({reason: "SPRedirect"}, "SPRedirect", curUri.getString());
					}
				} else {
					var path = curUri.getPath();
					if (path.substring(0, 2) !== '/:')
					{
						curUri.setPath("/:" + extension + ":/r" + path);
					}
					curUri.removeQueryParameter(_paramCT);
					curUri.removeQueryParameter(_paramOR);
					curUri.removeQueryParameter(_paramSlrid);
					if (wopiContext && wopiContext.ResetUriToAddressBarLink &&
						!path.endsWith("guestaccess.aspx") &&
						BrowserSupportsFetchAndPromise() &&
						window.self == window.top)
					{
						ResetToAddressBarLink(curUri);
					}
					else
					{
						history.replaceState({reason: "SPRedirect"}, "SPRedirect", curUri.getString());
					}
				}
			}
		  }
		  catch (e) {}
		}
	}
	if (wopiContext && !wopiContext.DelayLoadResources)
	{
	  postLogging();
	}
	ResetUrl();
